  true,\n\t\"url\": null,\n\t\"notes\": \"During the school year, many children receive
  free and reduced-price breakfast and lunch through the School Breakfast and National
  School Lunch Programs. What happens when school lets out? Hunger is one of the most
  severe roadblocks to the learning process. Lack of nutrition during the summer months
  may set up a cycle for poor performance once school begins again. Hunger also may
  make children more prone to illness and other health issues. The Summer Food Service
  Program is designed to fill that nutrition gap and make sure children can get the
  nutritious meals they need.  This data set contains information on summer food service
  participation, meals served and cash payments provided by state.\",\n\t\"license_title\":
